(function() {
  jQuery(function($) {
    var App, Forms, Slider;
    App = (function() {
      function App() {
        this.$body = $("body");
        this.$roots = $("html, body");
        this.post = /((page-id)|(postid))-(\d*)/g.exec(this.$body.attr("class"));
        this.post = this.post ? this.post[4] : false;
      }

      App.prototype.clicks = function() {
        return $("[data-click]").click(function(e) {
          e.preventDefault();
          switch ($(this).data("click")) {
            case "print":
              return window.print();
            case "windowed":
              return window.open($(this).attr("href"), "_blank", "location=yes,height=500,width=600,scrollbars=yes,status=yes");
          }
        });
      };

      return App;

    })();
    Forms = (function() {
      function Forms() {}

      Forms.transformSelect = function($el) {
        if ($el.data("value")) {
          $el.val($el.data("value"));
        }
        return $el.select2({
          minimumResultsForSearch: 5,
          placeholder: "Cliquez pour choisir"
        });
      };

      return Forms;

    })();
    Slider = (function() {
      function Slider($el1) {
        this.$el = $el1;
        this.slick = this.el.slick({
          speed: 750,
          dots: true,
          arrows: true,
          appendArrows: $(""),
          appendDots: $(""),
          prevArrow: null,
          nextArrow: null,
          appendDots: null
        }).on("beforeChange", this.beforeChange);
      }

      Slider.prototype.beforeChange = function(e, s, curr, next) {};

      return Slider;

    })();
    new App();
    $("select").each(function() {
      return Forms.transformSelect($(this));
    });
    return $(".incrementor").each(function() {
      return $(this).incrementor();
    });
  });

}).call(this);
